import React from "react";

const ArtistList = () => {
  const artists = [
    { id: "1", name: "Zeca" },
    { id: "2", name: "Arlindo" },
  ];

  return (
    <ListGroup>
      {artists.map((a) => (
        <ListGroup.Item key={a.id}>{a.name}</ListGroup.Item>
      ))}
    </ListGroup>
  );
};

export default ArtistList;
